import styled from "styled-components";
import { motion, useAnimation } from "framer-motion";

const DshbordComponenetStyle = styled(motion.div)`
  display: flex;
  flex-direction: column;
  position: relative;
  width: auto;
  left: 5vw;
  width: 90vw;
  margin-top: 150px;
  .tags {
    .tag {
      color: #8a8888;
      padding: 10px;
      margin: 10px;
    }
    .tag:first-child {
      margin-left: 0;
    }
  }
`;

const TestView = ({ tag }) => (
  <motion.span className={"viewModel " + tag.replace(" ", "_")}>
    {tag.replace(" ", "_")}
  </motion.span>
);

const DashbordComponenet = () => {
  let selected = 0;

  let controllers = {
    0: useAnimation(),
    1: useAnimation(),
    2: useAnimation(),
    3: useAnimation(),
    4: useAnimation(),
    5: useAnimation(),
  };

  return (
    <DshbordComponenetStyle>
      <div className="tags">
        {[
          "Dash board",
          "Posts",
          "Edit profile",
          "Subscription",
          "Billing address",
          "Submit post",
        ].map((e, i) => {
          return (
            <motion.span
              whileHover={{ color: "#f8f8f8" }}
              className="tag"
              onClick={async () => {
                console.log(e);
                await controllers[i];
              }}
            >
              {e}
            </motion.span>
          );
        })}
      </div>
      <div className="view">
        <TestView tag="Subscription" controllers={controllers[3]} />
        <TestView tag="Posts" controllers={controllers[1]} />
        <TestView tag="Edit profile" controllers={controllers[2]} />
      </div>
    </DshbordComponenetStyle>
  );
};

export default DashbordComponenet;
